insert into tb_filmes (titulo, descricao, url_da_capa, categoria, diretor, ano_de_lancamento, tempo_em_minutos) values ('Almirante', 'Almirante é um filme biográfico de 2008 sobre Alexander Kolchak, um vice-almirante da Marinha Imperial Russa e líder do movimento branco anticomunista durante a Guerra Civil Russa. O filme também retrata o triângulo amoroso entre o almirante, sua esposa e a poetisa Anna Timiryova.', 'https://www.themoviedb.org/t/p/w600_and_h900_bestv2/a3wtenkrqveejZpZadYakGIUExP.jpg', 'Drama|War', 'Yul Shellcross', 1973, 81 ),
    ('Snatch', 'Turkish e Tommy se juntam a um pugilista cigano chamado Mickey para lutas de boxe ilegais. Seus oponentes fazem apostas com um envolvido em um roubo de diamante. Para complicar, um detetive de Nova York entra em cena.', 'https://www.themoviedb.org/t/p/w600_and_h900_bestv2/56mOJth6DJ6JhgoE2jtpilVqJO.jpg', 'Comedy|Crime|Thriller', 'Mickie Wallsam ', 1986, 220),
    ('Eu sei o que você fez no verão passado', 'Um ano após atropelar um pescador e jogar o seu corpo na água, quatro amigos se reúnem quando Julie recebe uma carta assustadora dizendo-lhe que seu crime foi visto. Ao perseguir quem ele pensa ser responsável pela carta, Barry é atropelado por um homem com um gancho de carne.', 'https://www.themoviedb.org/t/p/w600_and_h900_bestv2/7OfTWTQEvPcwPrOdeLH0F3h6GRZ.jpg', 'Horror|Mistério|Thriller ', 'Godfry Darlaston', 1996, 218),
    ('Alto, largo e bonito', 'High, Wide and Handsome é um filme norte-americano de 1937, do gênero musical, dirigido por Rouben Mamoulian e estrelado por Irene Dunne e Randolph Scott. Produção de classe da Paramount Pictures, difícil de classificar, que não fez sucesso junto ao público.', 'https://www.themoviedb.org/t/p/w600_and_h900_bestv2/664haTfN5cwcltIYdUk0rXhXXfN.jpg ', 'Musical | Ocidental', 'Damara Priestnall', 2023, 43),
